def check_commutation():
    # Basic Pauli multiplication rules
    # I=0, X=1, Z=2, Y=3. Commute if different places are even or 0? 
    # Actually, two Paulis A and B anti-commute if they have odd number of places where they differ and neither is I.
    # X and Z anti-commute. Y and Z anti-commute. X and Y anti-commute.
    # (X, Z) -> anti
    # (X, Y) -> anti
    # (Y, Z) -> anti
    # Same Pauli commutes.
    # I commutes with everything.
    
    # Let's use stim to check if we can
    pass

try:
    # Convert strings to stim.PauliString objects
    stim_stabilizers = [stim.PauliString(s) for s in stabilizers]
    
    # Attempt to create tableau from stabilizers
    tableau = stim.Tableau.from_stabilizers(stim_stabilizers, allow_underconstrained=True)
    circuit = tableau.to_circuit('elimination')
    print("CIRCUIT_START")
    print(circuit)
    print("CIRCUIT_END")

except Exception as e:
    print(f"Error generating circuit: {e}")
    
    # Do manual check to see what's wrong
    n = len(stabilizers)
    anticommuting = []
    
    for i in range(n):
        for j in range(i + 1, n):
            s1 = stabilizers[i]
            s2 = stabilizers[j]
            anticommutes = 0
            for k in range(len(s1)):
                c1 = s1[k]
                c2 = s2[k]
                if c1 == 'I' or c2 == 'I' or c1 == c2:
                    continue
                anticommutes += 1
            
            if anticommutes % 2 == 1:
                anticommuting.append((i, j))
                
    if anticommuting:
        print(f"Found {len(anticommuting)} anticommuting pairs:")
        for i, j in anticommuting[:10]:
             print(f"  Index {i} vs {j}")
             print(f"  {stabilizers[i]}")
             print(f"  {stabilizers[j]}")
    else:
        print("All stabilizers commute according to manual check.")

